import { Component } from "react";
import { Container, Row, Co, Navbar, Nav } from "react-bootstrap";

import NavigationBar from "./NavigationBar.jsx";
import HomeContent from "./HomeContent.jsx";

class App extends Component {
  render() {
    return (
      <Container fluid>
        <NavigationBar />
        <HomeContent />
      </Container>
    )
  }
}

export default App;
